import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { fetchDashboardStats } from '../../store/slices/dashboardSlice';
import { fetchOrders } from '../../store/slices/ordersSlice';
import StatsCards from '../../components/dashboard/StatsCards';
import ActiveOrders from '../../components/dashboard/ActiveOrders';
import RecentActivity from '../../components/dashboard/RecentActivity';
import EarningsChart from '../../components/dashboard/EarningsChart';

const Dashboard = () => {
  const dispatch = useDispatch();
  const { partner } = useSelector((state) => state.auth);
  const { stats, loading } = useSelector((state) => state.dashboard);
  const { activeOrders } = useSelector((state) => state.orders);

  useEffect(() => {
    if (partner?.deliveryPartner?.id) {
      dispatch(fetchDashboardStats(partner.deliveryPartner.id));
      dispatch(fetchOrders({ partnerId: partner.deliveryPartner.id }));
    }
  }, [dispatch, partner]);

  if (loading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Page Header */}
      <div className="bg-white rounded-lg shadow p-6">
        <div className="flex items-center justify-between">
          <div>
            <h1 className="text-2xl font-bold text-gray-900">
              Welcome back, {partner?.fullName?.split(' ')[0] || 'Partner'}!
            </h1>
            <p className="text-gray-600 mt-1">
              Here's what's happening with your deliveries today.
            </p>
          </div>
          <div className="text-right">
            <div className="text-sm text-gray-500">Current Status</div>
            <div className={`inline-flex items-center px-3 py-1 rounded-full text-sm font-medium ${
              stats.availabilityStatus === 'ONLINE' 
                ? 'bg-green-100 text-green-800'
                : stats.availabilityStatus === 'BUSY'
                ? 'bg-yellow-100 text-yellow-800'
                : 'bg-gray-100 text-gray-800'
            }`}>
              <div className={`w-2 h-2 rounded-full mr-2 ${
                stats.availabilityStatus === 'ONLINE' 
                  ? 'bg-green-500'
                  : stats.availabilityStatus === 'BUSY'
                  ? 'bg-yellow-500'
                  : 'bg-gray-500'
              }`}></div>
              {stats.availabilityStatus?.toLowerCase() || 'Offline'}
            </div>
          </div>
        </div>
      </div>

      {/* Stats Cards */}
      <StatsCards stats={stats} />

      {/* Main Content Grid */}
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        {/* Active Orders - Takes 2 columns on large screens */}
        <div className="lg:col-span-2">
          <ActiveOrders orders={activeOrders} />
        </div>

        {/* Recent Activity - Takes 1 column */}
        <div className="lg:col-span-1">
          <RecentActivity />
        </div>
      </div>

      {/* Earnings Chart */}
      <div className="bg-white rounded-lg shadow">
        <EarningsChart />
      </div>

      {/* Quick Actions */}
      <div className="bg-white rounded-lg shadow p-6">
        <h3 className="text-lg font-semibold text-gray-900 mb-4">Quick Actions</h3>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-4">
          <button className="flex items-center justify-center p-4 border-2 border-dashed border-gray-300 rounded-lg hover:border-blue-500 hover:bg-blue-50 transition-colors duration-200">
            <div className="text-center">
              <svg className="w-8 h-8 text-gray-400 mx-auto mb-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12h6m-6 4h6m2 5H7a2 2 0 01-2-2V5a2 2 0 012-2h5.586a1 1 0 01.707.293l5.414 5.414a1 1 0 01.293.707V19a2 2 0 01-2 2z" />
              </svg>
              <span className="text-sm text-gray-600">View All Orders</span>
            </div>
          </button>

          <button className="flex items-center justify-center p-4 border-2 border-dashed border-gray-300 rounded-lg hover:border-blue-500 hover:bg-blue-50 transition-colors duration-200">
            <div className="text-center">
              <svg className="w-8 h-8 text-gray-400 mx-auto mb-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8c-1.657 0-3 .895-3 2s1.343 2 3 2 3 .895 3 2-1.343 2-3 2m0-8c1.11 0 2.08.402 2.599 1M12 8V7m0 1v8m0 0v1m0-1c-1.11 0-2.08-.402-2.599-1" />
              </svg>
              <span className="text-sm text-gray-600">View Earnings</span>
            </div>
          </button>

          <button className="flex items-center justify-center p-4 border-2 border-dashed border-gray-300 rounded-lg hover:border-blue-500 hover:bg-blue-50 transition-colors duration-200">
            <div className="text-center">
              <svg className="w-8 h-8 text-gray-400 mx-auto mb-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M16 7a4 4 0 11-8 0 4 4 0 018 0zM12 14a7 7 0 00-7 7h14a7 7 0 00-7-7z" />
              </svg>
              <span className="text-sm text-gray-600">Update Profile</span>
            </div>
          </button>

          <button className="flex items-center justify-center p-4 border-2 border-dashed border-gray-300 rounded-lg hover:border-blue-500 hover:bg-blue-50 transition-colors duration-200">
            <div className="text-center">
              <svg className="w-8 h-8 text-gray-400 mx-auto mb-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M18.364 5.636l-3.536 3.536m0 5.656l3.536 3.536M9.172 9.172L5.636 5.636m3.536 9.192L5.636 18.364M12 2.25a9.75 9.75 0 109.75 9.75A9.75 9.75 0 0012 2.25z" />
              </svg>
              <span className="text-sm text-gray-600">Help & Support</span>
            </div>
          </button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
